const initialState = {
  profile: null,
  profiles: [],
  reposr: [],
  loading: true,
  error: {},
};

const profileReducer = (state = initialState, action) => {
  const { type, payload } = action;

  switch (type) {
    case typeName:
      return { ...state, ...payload };

    default:
      return state;
  }
};

export default profileReducer;
